import React from 'react';
import './App.css';
import MarkdownArticle from './components/MarkdownArticle';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Markdown Article Website</h1>
      </header>
      <main>
        <MarkdownArticle articlePath="article1.md" />
      </main>
    </div>
  );
}

export default App;
